import logo from './logo.svg';
import './App.css';
import CustomerLoginForm from './Components/CustomerLoginForm';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';

function App() {

  const history = useHistory()

  const openCustomerLogin = () => {
    history.pushState('/CustomerLogin')
  };

  return (
  <div>
    <div className="App">
      <button onClick={openCustomerLogin}></button>
    </div>

    <Router>
      <Switch>

        <Route path="/CutomerLogin" component={CustomerLoginForm} />
      </Switch>
    </Router>


  </div>
  );
}

export default App;
